query:
mutation policyDynamicIpAllocationPublishPolicyRevision ( $accountId:ID! $dynamicIpAllocationPolicyMutationInput:DynamicIpAllocationPolicyMutationInput $policyPublishRevisionInput:PolicyPublishRevisionInput) {
	policy ( accountId:$accountId ) {
		dynamicIpAllocation ( input:$dynamicIpAllocationPolicyMutationInput  )  {
			publishPolicyRevision ( input:$policyPublishRevisionInput   ) {
				policy {
					enabled
					rules {
						audit {
							updatedTime
							updatedBy
						}
						rule {
							id
							name
							description
							index
							section {
								id
								name
							}
							enabled
							source {
								user {
									id
									name
								}
								usersGroup {
									id
									name
								}
							}
							platform
							country {
								id
								name
							}
							range {
								globalIpRange {
									id
									name
								}
							}
						}
						properties
					}
					sections {
						audit {
							updatedTime
							updatedBy
						}
						section {
							id
							name
						}
						properties
					}
					audit {
						publishedTime
						publishedBy
					}
					revision {
						id
						name
						description
						changes
						createdTime
						updatedTime
					}
				}
				status
				errors {
					errorMessage
					errorCode
				}
			}
		}
	}	
}
